import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import classes from './Users.module.css';
const Users = (props) => {
    return <div>
        {
        props.users.map( u => <div key={u.id}>
            <span>
                <div>
                    <img className={classes.profil_photo} src={u.photourl}/> 
                </div>
                <div>
                {u.follow
                ?<button>Follow</button>
            :<button>UnFollow</button>}
                </div>
            </span>
            <span>
                <span>
                     <div>{u.name}</div>
                     <div></div>
                </span>
                <span>
                     <div>
                     {u.location.city}
                     </div>
                     <div>
                     {u.location.country}
                     </div>
                </span>
            </span>
            </div>)
    }
    </div>
}






export default Users;
